import React, { Component } from "react";

class Bullet extends Component {

  constructor(props) {
    super(props);

    this.state = {
      name: "",
      note: "",
      completed: false,
      children: []
    }
  }

  componentDidMount() {
  }

  render() {
    return (
      <div></div>
    )
  }
}

export default Bullet;
